function triggerUnits(poly) {
  let reacted = poly;
  let len = 0;
  while (len !== reacted.length) {
    len = reacted.length;
    for (let i = 0; i < reacted.length - 1; i++) {
      if (Math.abs(reacted.charCodeAt(i) - reacted.charCodeAt(i + 1)) === 32) {
        reacted = reacted.slice(0, i) + reacted.slice(i + 2);
      }
    }
  }
  return reacted;
}

