function bestOverride(poly) {
    let min = poly.length
    let char = "A"
    for (let i="A".charCodeAt(0);i<="Z".charCodeAt(0);i++) {
        let t = triggerWithOverride(poly, String.fromCharCode(i)).length
        if (t<min) [min, char] = [t, String.fromCharCode(i)]
    }
    return {min, char}
}

function triggerWithOverride(poly, code) {
  let reacted = poly.replace(new RegExp(code, "gi"), "");
  reacted = triggerUnits(reacted);
  return reacted;
}

